import React, { useState } from 'react';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TableSortLabel,
  Paper,
  TablePagination,
  Collapse,
  IconButton,
  Box,
  useTheme
} from '@mui/material';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp';
import { getColumns } from './columns';
import { trackUserInteraction } from '../../utils/analytics';
import ExpandedRow from './ExpandedRow';

const Row = ({ pair, columns }) => {
  const [open, setOpen] = useState(false);
  const theme = useTheme();

  const handleRowClick = () => {
    setOpen(!open);
    trackUserInteraction.pairClick(pair.pairName);
  };

  return (
    <>
      <TableRow
        hover
        sx={{
          cursor: 'pointer',
          transition: 'all 0.2s',
          bgcolor: pair.is_blacklisted ? 'error.lighter' : 'background.default',
          '& > td': {
            borderBottom: 1,
            borderColor: 'divider',
            py: 2.5,
            '&:first-of-type': {
              borderTopLeftRadius: 8,
              borderBottomLeftRadius: open ? 0 : 8,
            },
            '&:last-of-type': {
              borderTopRightRadius: 8,
              borderBottomRightRadius: open ? 0 : 8,
            }
          },
          '&:hover': {
            bgcolor: pair.is_blacklisted ? 'error.light' : 'action.hover',
            transform: 'translateY(-2px)',
            boxShadow: theme.shadows[2],
            '& .expand-icon': {
              color: 'primary.main',
              transform: open ? 'rotate(-180deg) translateY(-2px)' : 'rotate(0) translateY(-2px)',
            }
          },
          mb: 1,
        }}
        onClick={handleRowClick}
      >
        <TableCell width="48px">
          <IconButton
            size="small"
            className="expand-icon"
            sx={{
              transition: 'all 0.2s',
              transform: open ? 'rotate(-180deg)' : 'rotate(0)',
              color: open ? 'primary.main' : 'text.secondary',
            }}
          >
            <KeyboardArrowDownIcon />
          </IconButton>
        </TableCell>
        {columns.map((column) => (
          <TableCell
            key={column.id}
            align={column.numeric ? 'right' : 'left'}
            sx={{
              color: column.highlight ? 'primary.main' : 'text.primary',
              fontWeight: column.highlight ? 600 : 400,
              fontSize: '0.875rem',
            }}
          >
            {column.render ? column.render(pair) : pair[column.id]}
          </TableCell>
        ))}
      </TableRow>
      <TableRow>
        <TableCell
          colSpan={columns.length + 1}
          sx={{
            p: 0,
            border: 0,
            bgcolor: 'background.paper',
            '&:first-of-type': {
              borderBottomLeftRadius: open ? 8 : 0,
            },
            '&:last-of-type': {
              borderBottomRightRadius: open ? 8 : 0,
            }
          }}
        >
          <Collapse in={open} timeout="auto" unmountOnExit>
            <Box sx={{ p: 3 }}>
              <ExpandedRow pair={pair} />
            </Box>
          </Collapse>
        </TableCell>
      </TableRow>
    </>
  );
};

const PairsTable = ({
  pairs,
  orderBy,
  order,
  page,
  rowsPerPage,
  handleSort,
  handleChangePage,
  handleChangeRowsPerPage,
  totalCount
}) => {
  const columns = getColumns();

  return (
    <TableContainer
      component={Paper}
      sx={{
        boxShadow: 2,
        borderRadius: 3,
        bgcolor: 'background.paper',
        '& .MuiTable-root': {
          borderCollapse: 'separate',
          borderSpacing: '0 8px'
        }
      }}
    >
      <Table aria-label="pairs table">
        <TableHead>
          <TableRow
            sx={{
              '& th': {
                borderBottom: 0,
                bgcolor: 'background.paper',
                py: 2,
                fontWeight: 600,
                color: 'text.secondary',
                fontSize: '0.75rem',
                textTransform: 'uppercase',
                letterSpacing: '0.05em'
              }
            }}
          >
            <TableCell width="48px" /> {/* Expand icon column */}
            {columns.map((column) => (
              <TableCell
                key={column.id}
                align={column.numeric ? 'right' : 'left'}
                sortDirection={orderBy === column.id ? order : false}
                sx={{
                  cursor: 'pointer',
                  '&:hover': {
                    color: 'primary.main'
                  }
                }}
                onClick={() => handleSort(column.id)}
              >
                <TableSortLabel
                  active={orderBy === column.id}
                  direction={orderBy === column.id ? order : 'asc'}
                  sx={{
                    '& .MuiTableSortLabel-icon': {
                      opacity: 0.5
                    }
                  }}
                >
                  {column.label}
                </TableSortLabel>
              </TableCell>
            ))}
          </TableRow>
        </TableHead>
        <TableBody>
          {pairs.map((pair) => (
            <Row
              key={pair.address}
              pair={pair}
              columns={columns}
            />
          ))}
        </TableBody>
      </Table>
      <TablePagination
        rowsPerPageOptions={[10, 25, 50, 100]}
        component="div"
        count={totalCount}
        rowsPerPage={rowsPerPage}
        page={page}
        onPageChange={handleChangePage}
        onRowsPerPageChange={handleChangeRowsPerPage}
        sx={{
          borderTop: 1,
          borderColor: 'divider',
          '& .MuiTablePagination-select': {
            bgcolor: 'background.default'
          }
        }}
      />
    </TableContainer>
  );
};

export default PairsTable;
